
import { useState, useEffect, ChangeEvent, KeyboardEvent } from 'react';
import './App.css';

interface Task {
    id: string;
    text: string;
    imageUrl: string;
}


const imageUrls = [
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,"
];  


const App = () => {
    const [tasks, setTasks] = useState<Task[]>([]);
    const [taskInput, setTaskInput] = useState('');
    const [selectedImage, setSelectedImage] = useState(imageUrls[0]);
    const [editingTaskId, setEditingTaskId] = useState<string | null>(null);
    const [editingText, setEditingText] = useState('');
    const [editingImage, setEditingImage] = useState<string>('');

    useEffect(() => {
        const fetchTasks = async () => {
            try {
                const response = await fetch('http://localhost:5000/tasks_');
                if (!response.ok) {
                    throw new Error('Erro ao buscar tarefas');
                }
                const data = await response.json();
                setTasks(data);
            } catch (error) {
                console.error('Erro ao buscar tarefas:', error);
            }
        };
        fetchTasks();
    }, []);

   /*  useEffect(() => {
        localStorage.setItem('tasks', JSON.stringify(tasks));
    }, [tasks]);
 */
    const addTask = async () => {
        if (taskInput.trim() === '') return;
    
        const newTask = { text: taskInput, imageUrl: selectedImage };
        try {
            const response = await fetch('http://localhost:5000/tasks_', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify(newTask),
            });
    
            if (!response.ok) {
                const errorText = await response.text();
                throw new Error(`Erro na resposta do servidor: ${errorText}`);
            }
    
            const data = await response.json();
            setTasks([...tasks, data]);
            setTaskInput('');
            setSelectedImage(imageUrls[0]);
        } catch (error) {
            console.error('Erro ao adicionar tarefa:', error);
        }
    };
    
    

    const deleteTask = async (id: string) => {
        try {
            const response = await fetch(`http://localhost:5000/tasks_/${id}`, {
                method: 'DELETE',
            });
    
            if (!response.ok) {
                const errorText = await response.text();
                throw new Error(`Erro na resposta do servidor: ${errorText}`);
            }
    
            setTasks(tasks.filter(task => task.id !== id));
        } catch (error) {
            console.error('Erro ao excluir tarefa:', error);
        }
    };
    

    const startEdit = (task: Task) => {
        setEditingTaskId(task.id);
        setEditingText(task.text);
        setEditingImage(task.imageUrl);
    };

    const saveEdit = async () => {
        if (editingText.trim() === '') return;
    
        const updatedTask = { text: editingText, imageUrl: editingImage };
    
        try {
            const response = await fetch(`http://localhost:5000/tasks_/${editingTaskId}`, {
                method: 'PUT',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify(updatedTask),
            });
    
            if (!response.ok) {
                const errorText = await response.text();
                throw new Error(`Erro na resposta do servidor: ${errorText}`);
            }
    
            const data = await response.json();
            setTasks(tasks.map(task =>
                task.id === editingTaskId ? { ...task, text: data.text, imageUrl: data.imageUrl } : task
            ));
            setEditingTaskId(null);
            setEditingText('');
            setEditingImage('');
        } catch (error) {
            console.error('Erro ao salvar edição:', error);
        }
    };
    

    const handleInputChange = (e: ChangeEvent<HTMLInputElement>) => {
        setTaskInput(e.target.value);
    };

    const handleEditChange = (e: ChangeEvent<HTMLInputElement>) => {
        setEditingText(e.target.value);
    };

    const handleImageChange = (e: ChangeEvent<HTMLSelectElement>) => {
        setSelectedImage(e.target.value);
    };

    const handleEditImageChange = (e: ChangeEvent<HTMLSelectElement>) => {
        setEditingImage(e.target.value);
    };

    const handleKeyPress = (e: KeyboardEvent) => {
        if (e.key === 'Enter') {
            addTask();
        }
    };

    return (
        <div className="app">
            <h1>Lista de Tarefas</h1>
            <div>
                <input
                    type="text"
                    value={taskInput}
                    onChange={handleInputChange}
                    onKeyPress={handleKeyPress}
                    placeholder="Adicionar nova tarefa"
                />
                <select onChange={handleImageChange} value={selectedImage}>
                    {imageUrls.map((url, index) => (
                        <option key={index} value={url}>Imagem {index + 1}</option>
                    ))}
                </select>
                <button onClick={addTask}>Adicionar</button>
            </div>
            <ul>
                {tasks.map(task => (
                    <li key={task.id}>
                        <img src={task.imageUrl} alt="Task Icon" />
                        {editingTaskId === task.id ? (
                            <>
                                <input
                                    type="text"
                                    value={editingText}
                                    onChange={handleEditChange}
                                />
                                <select onChange={handleEditImageChange} value={editingImage}>
                                    {imageUrls.map((url, index) => (
                                        <option key={index} value={url}>Imagem {index + 1}</option>
                                    ))}
                                </select>
                                <button onClick={saveEdit}>Salvar</button>
                            </>
                        ) : (
                            <>
                                {task.text}
                                <button onClick={() => startEdit(task)}>Editar</button>
                                <button onClick={() => deleteTask(task.id)}>Excluir</button>
                            </>
                        )}
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default App;
